import './ExpenseItem.css';
import Title from "./Title";
import Date from "./Date";
import Amount from "./Amount";

function ExpenseItem() {
    return <div>
        <Date></Date>
        <Title></Title>
        <Amount></Amount>
    </div>
}

export default ExpenseItem;
